const html = '<h2 id="props" tabindex="-1">Props <a class="header-anchor" href="#props" aria-hidden="true">#</a></h2>\n<h4 id="node" tabindex="-1">Node <a class="header-anchor" href="#node" aria-hidden="true">#</a></h4>\n<p>An object representing the Root node of the Tree. Each node must contain the\nfollowing properties:</p>\n<ul>\n<li>\n<p><strong>label</strong> (string) - Name of the node.</p>\n</li>\n<li>\n<p><strong>children</strong> (Node[]) - An array of nodes representing the children of the\ncurrent node.</p>\n</li>\n</ul>\n<br>\n<h4 id="options" tabindex="-1">Options <a class="header-anchor" href="#options" aria-hidden="true">#</a></h4>\n<ul>\n<li>\n<p><strong>rowHeight</strong> (string) - Line height for the nodes passed. Defaults to <code>25px</code>.</p>\n</li>\n<li>\n<p><strong>indentWidth</strong> (string) - Width for the indentation at each depth of the\ntree. Gets incremented with every nested sub-tree. Defaults to <code>15px</code>.</p>\n</li>\n<li>\n<p><strong>showIndentationGuides</strong> (boolean) - Flag for displaying LHS lines. Defaults\nto <code>true</code>.</p>\n</li>\n</ul>\n<br>\n<h2 id="slots" tabindex="-1">Slots <a class="header-anchor" href="#slots" aria-hidden="true">#</a></h2>\n<h4 id="_1-custom-node" tabindex="-1">1. Custom Node <a class="header-anchor" href="#_1-custom-node" aria-hidden="true">#</a></h4>\n<p>Slot to optionally override the template for the entire node. It exposes the\nfollowing slot props:</p>\n<ul>\n<li>\n<p><strong>node</strong> (object) - The current node containing label and children attributes.</p>\n</li>\n<li>\n<p><strong>hasChildren</strong> (boolean) - Whether current node is a leaf node.</p>\n</li>\n<li>\n<p><strong>isCollapsed</strong> (boolean) - Whether current node is collapsed.</p>\n</li>\n<li>\n<p><strong>toggleCollapsed</strong> (function) - Function to expand or collapse the node.</p>\n</li>\n</ul>\n<p>Example:</p>\n<pre><code>// Customising node to show needed Context Menu\n&lt;template #node=&quot;{ node, hasChildren, isCollapsed, toggleCollapsed }&quot;&gt;\n    &lt;div class=&quot;flex items-center&quot; @click.right=&quot;showContextMenu(node)&quot;&gt;\n    ...\n    &lt;/div&gt;\n&lt;/template&gt;\n</code></pre>\n<br>\n<h4 id="_2-custom-label-icon" tabindex="-1">2. Custom Label / Icon <a class="header-anchor" href="#_2-custom-label-icon" aria-hidden="true">#</a></h4>\n<p><code>label</code> and <code>icon</code> slots to quickly add custom styles without overriding the\nentire node.</p>\n';
